import React from 'react';
import {Card} from 'react-bootstrap';
import style from './composer.module.css'

export const Composer = () => {
    return (
       <Card>
           <Card.Body>
               <Card.Title>What about thinking?</Card.Title>
               <textarea className={style.composer}></textarea>
           </Card.Body>
       </Card>
    )
}
